import React, { useEffect, useState } from 'react'
import axios from "axios"

const Music = () => {

  const [music,setMusic] =useState([])
  useEffect(()=>{
    const fetchAllMusic = async ()=>{
      try{
        const res = await axios.get("http://localhost:8800/music")
        console.log(res)
      }catch(err){
        console.log(err)
      }
    }
    fetchAllMusic()
  },[])

  return (
    <div>
      MUSIC
    </div>
  )
}

export default Music
